import A from './Components/A'
import TestContext from './store/testContext'

export default function App() {
  return (
    <TestContext.Consumer>
        {(ctx) => {
            return <div>{ctx.name}-{ctx.age}</div>
        }}
    </TestContext.Consumer>
  )
}
